import "./Main.css";

const Main = () => {
  return (
    <div className="main-container">
      <div>
        <h1>This is the homepage!</h1>
      </div>
      <div>
        <input type="text" id="search" name="value">Search Country</input>
      </div>
    </div>
  );
};

export default Main;
